-- Nếu có, xóa cơ sở dữ liệu "trà sữa" cũ
DROP DATABASE IF EXISTS webtrasua;
-- Tạo cơ sở dữ liệu "trà sữa" mới
CREATE DATABASE webtrasua;
use webtrasua;

CREATE TABLE `category` (
  `id` int(11) NOT NULL AUTO_INCREMENT primary key,
  `name` nvarchar(50) NOT NULL,
  `createdat` datetime DEFAULT NULL,
  `updatedat` datetime DEFAULT NULL,
  `image` varchar(500) NOT NULL,
  `detail` nvarchar(1000)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT primary key,
  `fullname` nvarchar(100) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `address` varchar(200) NOT NULL,
  `note` varchar(255) DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  `state` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


CREATE TABLE `product` (
  `id` int(11) NOT NULL AUTO_INCREMENT primary key,
  `title` nvarchar(200) NOT NULL,
  `price` int NOT NULL,
  `idcate` int(11) NOT NULL,
  `createdat` datetime DEFAULT NULL,
  `updatedat` datetime DEFAULT NULL,
  `image` varchar(500) NOT NULL,
  `status` nvarchar(255) DEFAULT NULL,
  FOREIGN KEY (`idcate`) REFERENCES `category` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `order_details` (
  `id` int(11) NOT NULL ,
  `idprod` int(11) NOT NULL,
  `num` int(11) NOT NULL,
  FOREIGN KEY (`id`) REFERENCES `orders` (`id`),
  FOREIGN KEY (`idprod`) REFERENCES `product` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `users` (
	`id` int(11) NOT NULL AUTO_INCREMENT primary key,
    `name` nvarchar(100) NOT NULL,
    `pass` nvarchar(100) NOT NULL,
    `email` nvarchar(100) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `role` (
	`id` int(11) NOT NULL,
    `permission` nvarchar(100) NOT NULL,
    FOREIGN KEY (`id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;






